import React from 'react';
import {
Nav,
NavLink,
Bars,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavbarElements';

const Navbar = () => {
return (
	<>
	<Nav>
		<Bars />
		<NavMenu>
		<NavLink to='/Home' activeStyle>
			Home
		</NavLink>
		<NavLink to='/team' activeStyle>
			Employee 
		</NavLink>
		<NavLink to='/team' activeStyle>
			Schedule Work 
		</NavLink>
		<NavLink to='/team' activeStyle>
			Salary 
		</NavLink>
		
		<NavLink to='/about' activeStyle>
			About
		</NavLink>
		</NavMenu>
		
	</Nav>
	</>
);
};

export default Navbar;
